import styled from "styled-components";

import * as C from "@styled/common/components";

export const Project = styled(C.Container)`
	padding-top: 10rem;
	text-align: center;
`;

export const Title = C.SectionTitle;

export const Description = styled.p`
	font-size: 2rem;
	line-height: 200%;
`;
